webpackJsonp([0x61251006d456],{322:function(e,t){e.exports={data:{markdownRemark:{id:"/Users/benjaminmodayil/Documents/sites/modayilme_gatsby/src/pages/posts/blog/09-22-2017-a-new-way-todo/index.md absPath of file >>> MarkdownRemark",html:'<p>Creating todos are one of my favorite things todo and most likely they are yours as well. For a whole lot of us there is a joyous feeling of being organized and having things that make us feel busy. But simply, we hate actually doing them.</p>\n<p>Unless those todos relate themselves to a passion, they will most likely not get done on time‚Ä¶ or ever. The worst part about it all is that when we see long lists of todo items we get overwhelmed and slightly depressed when we don‚Äôt aren‚Äôt actually completing anything.</p>\n<p>I always tell myself that finding the right todo application will actually make me productive. That it will make me want to get stuff done.</p>\n<p>I‚Äôve actually bought and downloaded multiple types of todo list applications over the last few years. None of them changed me, and in turn, I‚Äôve given up on general todo lists that were designed to be used in a particular way.</p>\n<blockquote>\n<p>I‚Äôm tired of using a todo list as an excuse to not getting things done.</p>\n</blockquote>\n<p>I think we need to stop treating a todo list as a life changing object. Todo lists won‚Äôt change our desire to be productive. Only practicing being productive will make us productive.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.51820728291317%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Excel for ToDos"\n        title=""\n        src="/static/59db0ca8a4ff736fcadac9d57ce78cdf-90c66.png"\n        srcset="/static/59db0ca8a4ff736fcadac9d57ce78cdf-00ad5.png 200w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-da9b7.png 400w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-90c66.png 800w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-f7205.png 1200w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-9a3fd.png 1428w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>At the moment, I‚Äôm trying to not let a application define my mood. At the moment, I‚Äôll just stick with Excel until I find a better practice.</p>',frontmatter:{date:"13 October, 2016",title:'A New Way ToDo  <span role="img" aria-label="" alt="">‚úÖ</span> ',tldr:"Ben tries todo things",path:"/blog/a-new-way-todo"}}},pathContext:{path:"/blog/a-new-way-todo",prev:{html:'<h2>Hey there!</h2>\n<p>I‚Äôm Benjamin Modayil, a front-end developer from Philadelphia, Pennsylvania. Currently, I‚Äôm fun-employed. Looking for new opportunities, but also just taking time to reflect on the past four years of college at Cedarville University and the last four months with Viget for what started as an internship then turned apprenticeship.</p>\n<p>On my site, you‚Äôll find blog posts about things I‚Äôm learning, things I‚Äôm pursuing, and things I‚Äôm thinking.</p>\n<p>If you‚Äôre a possible employer, feel free to check out some of my work posts on my <a href="/">home page</a> and <a href="/contact">HMU</a> (‚Äúhit me up‚Äù, slang for ‚Äúcontact me‚Äù as all these cool millenials say). But if using b-boy slang like ‚ÄúHMU‚Äù rubs you the wrong way, then we‚Äôre probably not a match (albeit, I know how to handle myself circumstantially).</p>\n<p>I‚Äôll write some about my experience in the coming weeks, but for now‚Ä¶ HEY! Welcome to the new site.</p>',id:"/Users/benjaminmodayil/Documents/sites/modayilme_gatsby/src/pages/posts/blog/09-21-2017-first-blog/index.md absPath of file >>> MarkdownRemark",frontmatter:{layout:"blog",title:'Welcome  <span role="img" aria-label="" alt="">üëã</span> ',tldr:"Welcome to the new site",path:"/blog/first-post",type:"blog",external:null}},next:{html:"<p>Creating todos are my jam and most likely they are yours too. For a whole lot of us there is a joyous feeling of being organized and having things todo. But simply, we hate actually doing them.</p>\n<p>Unless those todos relate themselves to a passion, they will most likely not get done on time‚Ä¶ or ever.</p>\n<p>I always tell myself that finding the right todo list will actually make me productive. That it will make me want to get stuff done.</p>\n<p>I‚Äôve actually bought and downloaded multiple types of todo list applications over the last few years. None of them changed me, and in turn, I‚Äôve given up on todo lists that were designed to be used in a certain way.</p>\n<blockquote>\n<p>I‚Äôm tired of using a todo list as an excuse to not getting things done.</p>\n</blockquote>\n<p>I think we need to stop treating a todo list as a life changing object. Todo lists won‚Äôt change our desire to be productive. Only practicing being productive will make us productive.</p>\n<p>For me, I‚Äôll just stick to Excel.</p>\n<p></p>",id:"/Users/benjaminmodayil/Documents/sites/modayilme_gatsby/src/pages/posts/blog/09-24-2017-external-text-snippets/index.md absPath of file >>> MarkdownRemark",frontmatter:{layout:"blog",title:"Text-Snippets for Work and Play",tldr:"Text-snippets can save you valuable time whether for Work or Play.",path:"/external/alssdfasdf",type:"blog",external:"https://www.viget.com/articles/text-snippets-for-work-and-play"}}}}}});
